@ADHDdesigner 1/2: I stopped setting myself up for failure with resolutions, bc I’d end up defeated. Now, I choose a word/phrase for the New Year’s intention for growth. For example, in 2019 I literally focused on being INTENTIONAL (in everything).
2020: ASK FOR HELP.
2021: TRUST (of self).

@_KY_Jelly 🤣🤣🤣
Stretch breaks &amp; donut breaks were the only things I joined in from my desk.
This squat challenge was posted today by a trainer in my former office building’s gym (who has an incredible behind). But miss ma’am, who tryna sweat in slacks?

@randyraydolly My entire childhood even through early adulthood I slept fully clothed, because I had this exact same phobia. My mom thought I was crazy. 
I didn’t even sleep braless until I had my first baby &amp; only began sleeping naked or bottoms only post-divorce. 
Love embracing nakey time!!

@maybe_lizard My youngest and middle broke the same arm in the same place, only 6 weeks apart from each other. 🥲 They must be talented because both incidents occurred indoors. 😆 
1 in gymnastics class 🤸‍♀️ 
The other fell off his bed while jumping 🐒

@darbysparkman_ If they allow awkward silence or long pauses it’s likely to see how you’ll respond.
This is to see if you’ll be uncomfortable and then talk to fill the void, therefore giving away more than they’re even asking.
Don’t be afraid to pause and take a breath yourself. Good luck!! 😁

